      SELECT DISTINCT - cor0.col0 + - 60 - - col0 * - col1 * + col0 AS col0 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q400.out
    data: |
      -297
      -41084
      -83340
